import { useNavigate } from 'react-router-dom';

export default function Booking() {
  const navigate = useNavigate();

  function handleBook(movie) {
    // pass selected movie to payment page
    navigate('/payment', { state: { movie } });
  }

  return (
    <>
      <h2>Movies List</h2>
      <button onClick={() => handleBook('Avengers')}>Book Avengers</button>
      <button onClick={() => handleBook('Interstellar')}>Book Interstellar</button>
      <button onClick={() => handleBook('KGF')}>Book KGF</button>
    </>
  );
}
